import React, { useState, useEffect } from 'react';


export default function AlcoholDay(props) {

function alcoholDayFormats(num){

    if(num==0)
    return <div style={{ backgroundColor: '#55efc4', height:'100%',width:'100%' }}>
    &#129304;	
   </div>
   if(num>0)
   return <div style={{ backgroundColor: '#55efc4', display: 'flex', margin: 'auto', justifyContent: 'center', paddingTop: '15px' }}>
   {num}
  </div>


}

function routeToRightDayType(type, num){
    if(type==='alcohol')
        return alcoholDayFormats(num);
   else if(type==='diet')
        return alcoholDayFormats(num);
    else if(type==='workout')
        return alcoholDayFormats(num);

}

  return (
    <div height='100%' width="100%" style={{ display: 'flex', margin: 'auto', justifyContent: 'center', paddingTop: '15px' }}>
     {routeToRightDayType(props.calendarType,props.dayData)}

    </div>
  )
}
